    def udp_client(self, num_requests=10):
        """UDP"""
        results = []
        sock = self.create_udp_socket()
        
        try:
            for i in range(num_requests):
                start_time = time.time()
                
                # 
                sock.sendto(self.message, (self.host, self.port))
                
                # UDP
                try:
                    sock.settimeout(2.0)  # 2
                    response, addr = sock.recvfrom(self.message_size)
                    end_time = time.time()
                    
                    latency = (end_time - start_time) * 1000  # 
                    results.append(latency)
                    
                    print(f"UDP {i+1}:  {latency:.2f} ms,  {len(response)} ")
                except socket.timeout:
                    print(f"UDP {i+1}: ")
                    
        except Exception as e:
            print(f"UDP: {e}")
        finally:
            sock.close()
        
        return results

